import React from 'react';
import Navigation from './Navigation';

const Layout = ({children})=>{
    return(
        <>
            <div>
                <Navigation />                
            </div>
                <div>
                    {children}
                </div>
            <style jsx>{`
            div{
                background: #BF2642;
                width: 100%;
                height: 6.5em;
            }
        `}</style>
        </>
    )
}
export default Layout;
